import React from "react";
import Home from "./pages/Home";
import Navbar from "./components/Navbar";

import { Route, Routes } from "react-router-dom";


const App = () => {
  return (
    <section className="">
      <Navbar />

      <main>
        <Routes>
          <Route path="/" element={<Home />} />

        </Routes>
      </main>

    </section>
  );
};

export default App;
